import { useZohoContext } from "../Context/ZohoContext";

const SearchStores = () => {
    const {setLink}=useZohoContext();
    return ( 
        <div>
            <label htmlFor="stores">Ingrese ID de Store</label>
            <input type="text" />
            <button onClick={setLink("openWidget")}>Volver</button>
        </div>
     );
}
 
export default SearchStores;
